import React from 'react';
import Nav from './components/Nav';
import Home from './components/Home';
import {HashRouter as HashRouter, Routes ,Route} from 'react-router-dom';

function App () {
    return (
        <HashRouter>
            <Routes>
                <Route link='/' component={<Home />}></Route>
            </Routes>
        </HashRouter>
    )
}

export default App;
